description:
Créée en 2001, SIGMA Conseil est une société spécialisée dans les transports ferroviaires et urbains, intervenant auprès des Autorités Organisatrices des Transports, des collectivités locales, des exploitants et des gestionnaires d’infrastructure.

SIGMA Conseil est organisée autour d’une équipe d’ingénieurs généralistes s’appuyant sur un réseau de 120 consultants indépendants. Les équipes projets sont constituées de manière à répondre « sur-mesure » aux demandes des donneurs d’ordre.

SIGMA Conseil intervient dans cinq domaines :

-              L’Assistance à la conduite de projets conséquents et multidisciplinaires ;
-              Les études d’exploitation ;
-              Les études de maintenance ;
-              L’assistance technique sur l’ensemble des systèmes (infrastructure, matériel roulant, systèmes courant fort, systèmes courant faible) ;
-              La formation.

Notre catalogue de formations 2015 vient de paraitre : http://www.sigma-conseil.fr/index.php/formation

Minotore was founded in 2013 by traders and financial engineers from the largest European banking groups.
A key player in digital transformation support for financial markets, the Minotore group currently has two offices: in Paris and Tunis. 

Minotore offers a new approach to designing tailor-made digital solutions for financial markets. We hold a unique position among IT development and consulting companies because:

• We’re industry experts, providing our clients with high added value;
• We provide high-security customized digital tools at competitive prices;
• Thanks to our multidisciplinary team and wide variety of skills, we’ve mastered the production process;
• We build valuable long-term partnerships. 

Minotore is, first and foremost, a powerful network of experts with diverse and complementary skills. Our team is the result of a strong talent management strategy designed to attract, train and retain the employees we need to succeed both today and tomorrow.
